public class Solution {
    public int[][] ConstructProductMatrix(int[][] grid) {
        int n = grid.Length;
        int m = grid[0].Length;
        int[][] result = new int[n][];

        // Initialize the result matrix
        for (int i = 0; i < n; i++) {
            result[i] = new int[m];
        }

        // Calculate row and column products
        long[] rowProducts = new long[n];
        long[] colProducts = new long[m];
        for (int i = 0; i < n; i++) {
            rowProducts[i] = 1;
            for (int j = 0; j < m; j++) {
                rowProducts[i] = (rowProducts[i] * grid[i][j]) % 12345;
            }
        }

        for (int j = 0; j < m; j++) {
            colProducts[j] = 1;
            for (int i = 0; i < n; i++) {
                colProducts[j] = (colProducts[j] * grid[i][j]) % 12345;
            }
        }

        // Construct the product matrix
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < m; j++) {
                long product = 1;
                for (int k = 0; k < n; k++) {
                    if (k != i) product = (product * grid[k][j]) % 12345;
                }
                for (int k = 0; k < m; k++) {
                    if (k != j) product = (product * grid[i][k]) % 12345;
                }
                result[i][j] = (int)product;
            }
        }

        return result;
    }
}
